import "./User.scss";

const { Text } = Typography;

const User = () => {
  return (
    <Row justify="start" align="middle" className="user">
      <Space>
        <Avatar size={50} style={{ borderRadius: "16px" }} /> <Title level={5}>John Smith</Title>
      </Space>
    </Row>
  );
};

export default User;
